    // Update is called once per frame
    void Update()
    {
        //first gather current keypress matrix
        int key_row = 0;
        for (int i = 0x15; i <= 0x6D; i++)
        {
            if (key_row == 88)
            {
                //shouldn't but just in case
                break;
            }
            //if key is down already only change state on key up
            if (key_down_matrix[key_row])
            {
                if (MidiMaster.GetKeyUp(MidiChannel.All, i))
                { key_down_matrix[key_row] = false; }
            }
            //else key is up already and should only change state on key down
            else
            {
                if (MidiMaster.GetKeyDown(MidiChannel.All, i))
                { key_down_matrix[key_row] = true; }
            }

            key_row++;
        }

        //now we gather the time since the start of the song
        //WARNING: time may be innacurate due to packet compression
        //this also rounds to nearest 1/10 second
        if (time != (decimal)33.3) //stop demo at 33.3
        { 
            time = Math.Round((decimal)audio_blank.time, 1);
            green_count_final = green_count;
            red_count_final = red_count;
        }
        else
        {
            //print(audio_blank_object.transform.position);
            audio_blank_object.transform.position = new Vector3(0, -3.7f, 0);
            audio.Pause();
            print("Correct: " + green_count_final.ToString());
            print("Incorrect: " + red_count_final.ToString());
            print("Percent: " + (green_count_final / (red_count_final + green_count_final)).ToString());
            if ((green_count_final / (red_count_final + green_count_final)) > .5f)
            { print("Good Job!"); }
            else
            {
                print("Better luck next time!");
            }
        }
        time_i = Convert.ToInt16(time * 10);
        time_i = time_i - delay_i;
        if (time_i < 0)
        {
            time_i = 0;
        }
        //print("here");
        if(time==(decimal)4.9)
        {
            audio.Play();
           // print(time_i);
           // print(audio_blank.time);
        }
        //print(time.ToString());
        //now we compare the key_down matrix to piano_roll matrix given the time
        //this generates our correct matrix
        for (int key = 0; key < 88; key++)
        {
            //correct matrix is true for a key if that key's up/down position matches the piano_roll
            if (key_down_matrix[key] == Convert.ToBoolean(piano_roll[time_i, key]))
            {
                correct_matrix[key] = true;     
            }
            else
            {
                correct_matrix[key] = false;
            }
        }
        
        for(int key=0; key< 88; key++)
        {
            child_key = GameObject.Find(key_names[key]);
            //if key is correctly down
            if (key_down_matrix[key] && correct_matrix[key])
            {
                //change key to green
                Renderer rend = child_key.GetComponent<Renderer>();
                //rend.material.shader = Shader.Find("Specular");
                rend.material.SetColor("_Color", Color.green);
                green_count++;
            }
            //if key is correctly up
            else if (!key_down_matrix[key] && correct_matrix[key])
            {
                //change key to original color
                Renderer rend = child_key.GetComponent<Renderer>();
                //rend.material.shader = Shader.Find("Specular");
                rend.material.SetColor("_Color", original_key_colors[key]);
            }
            //in the two remaining cases, key incorrectly up/down
            else
            {
                //change key to red
                Renderer rend = child_key.GetComponent<Renderer>();
                //rend.material.shader = Shader.Find("Specular");
                rend.material.SetColor("_Color", Color.red);
                red_count++;
            }
        }
    }
